module.exports = "<h1 id=\"backups\">Backups</h1>\n<h2 id=\"local-wallet\">Local Wallet</h2>\n<p>It is recommended to make regular backups of your Local Wallet even though in most\ncases a single backup may be sufficient. Please note that in order to recover\nfrom a backup you will also need to provide the passphrase (password) because <strong>backups\nare encrypted</strong>. Hence, if you either lose your wallet or your passphrase you\nwill be unable to access any of your funds again!</p>\n<p>You can create a backup from <a href=\"/settings\">Settings -&gt; Backup</a>.</p>\n<ul>\n<li>Store this backup in at least two secure locations only accessible by you</li>\n<li>The backup is encrypted with your passphrase/password so do not store your passwrod in the same location</li>\n</ul>\n<h2 id=\"advanced-users-only\">Advanced Users Only</h2>\n<h3 id=\"brainkey\">Brainkey</h3>\n<blockquote>\n<p>If you never manually imported an account key into your wallet, you can\nalternatively backup your accounts and their funds by exporting the <em>brainkey</em>,\na string of words from which your keys are derived deterministically.</p>\n</blockquote>\n<p>Remark: Hierarchical Authorities (advanced uses ONLY)</p>\n<blockquote>\n<p>If you are using hierarchical authorities (account and/or active permissions),\nbacking up your keys alone may not be sufficient to regain access to your funds!\nPlease revise the documentations about hierarchical authorities.</p>\n</blockquote>\n";

