module.exports = "<h1 id=\"voting\">Voting</h1>\n<blockquote>\n<p>Voting is important in Bitshares in the same way it is important to the community in which you live. The weight of your vote is directly correlated to the number of BTS you own. If you aren&#39;t heavily involved in the community, you are encouraged to choose a proxy who represents your interests. If you would like to be more involved in the community, check out these <a href=\"/help/introduction/bitshares\">channels</a>.</p>\n</blockquote>\n<h2 id=\"proxy\">Proxy</h2>\n<p>You may choose to <strong>not</strong> be active in the governance of Bitshares. If this is the case, it&#39;s important that you choose someone in the Bitshares community who you identify with and set that entity as your proxy. This gives them to the power to vote on your behalf with your BTS shares backing their vote. This is similar to electing a representative.</p>\n<h2 id=\"witnesses\">Witnesses</h2>\n<p>Witnesses are entities that work for the blockchain by constructing new blocks. Their role is similar to the role of miners for Bitcoin and other blockchains. Each witness is approved by the shareholders and constructs and signs blocks from validated transactions. Every transaction made in the network is required to be validated by all witnesses.</p>\n<h3 id=\"consensus-mechanism\">Consensus Mechanism</h3>\n<p>Who exactly is allowed to <em>produce</em> a block at which time instant is defined by a\nconsensus mechanism called <em>Delegated Proof of Stake</em>. In essence, you, the\nshareholders of BitShares can cast a vote for your preferred block producers on the blockchain. Those <em>witnesses</em> with the most votes are allowed to produce blocks.</p>\n<h2 id=\"committee\">Committee</h2>\n<p>The committee is a set of entities that are approved by the shareholders and set policy for the Bitshares blockchain including:</p>\n<ul>\n<li>Transaction and trading fees</li>\n<li>Blockchain parameters, such as block size, block interval</li>\n<li>Referral and vesting parameters such as cash back percentage and vesting periods</li>\n</ul>\n<h2 id=\"workers\">Workers</h2>\n<p>Workers are proposals to perform a service in return for a salary from the blockchain. A worker proposal contains at a minimum the following information:</p>\n<ul>\n<li>A start and end date</li>\n<li>A daily pay</li>\n<li>A maximum total pay</li>\n<li>A link to a webpage where the worker proposal is explained</li>\n</ul>\n<h3 id=\"worker-lifecycle\">Worker Lifecycle</h3>\n<h4 id=\"proposed\">Proposed</h4>\n<p>These worker proposals have been submitted to the blockchain and are being actively voted on. In order to become active, they must exceed the refund400k worker in total votes.</p>\n<h4 id=\"active\">Active</h4>\n<p>These worker proposals have exceeded the threshold and are being actively paid. Active workers can be defunded if their vote threshold is reduced below the refund400k worker level.</p>\n<h4 id=\"expired\">Expired</h4>\n<p>These worker proposals are displayed for historical purposes. You will find propsals that have ended based upon their end date.</p>\n<h3 id=\"worker-budget-mechanics\">Worker budget mechanics</h3>\n<p>Workers receive pay from a fixed daily budget on a first-come, first-serve basis until there are no more funds left.</p>\n<ul>\n<li>A daily total budget of 400k BTS for all workers</li>\n<li>5 worker proposals with a positive votes total, with daily pay requests of 100k BTS each</li>\n</ul>\n<p>Now the four workers with the most votes will all receive 100k BTS each per day, but once they&#39;ve been paid the worker budget is empty. Therefore the fifth worker will receive nothing.</p>\n";

