module.exports = "<p>[# lifetime]</p>\n<h3 id=\"-feescashback-\">取引手数料の{feesCashback}%のキャッシュバックを受けよう</h3>\n<p>終身会員になることで、取引手数料に対して{feesCashback}%のキャッシュバックを受けられ、ネットワークにユーザーを紹介することで紹介収入を得ることができるようになります。終身会員権の価格はたったの{price}です。</p>\n<p>[# fee-division]</p>\n<h4 id=\"-\">手数料割り当てについて</h4>\n<p>{account}が取引手数料を支払う度に、その手数料はいくつかの異なる口座に分けられていきます。まず、ネットワークは{networkFee}%、{account}を紹介した終身会員は{lifetimeFee}%を受け取ります。</p>\n<p>レジストラとは、{account}をネットワークに登録するための取引手数料を支払ったアカウントのことです。レジストラは、残りの{referrerTotalFee}%を自分自身と、レジストラが展開しているアフィリエイト紹介プログラムの間でどのように分割するかを決定することができます。</p>\n<p>{account}のレジストラは、総費用の{referrerFee}%をアフィリエイト紹介者と共有し、総費用の{registrarFee}%を自己で保つことを選択しました。</p>\n<h4 id=\"-\">保留中の取引手数料</h4>\n<p>{account}によって支払われた取引手数料は、メンテナンスインターバル（{maintenanceInterval}秒）ごとに1回、ネットワーク、紹介者、レジストラの間で分割されます。次のメンテナンス時間は{nextMaintenanceTime}です。</p>\n<h4 id=\"-\">権利確定手数料</h4>\n<p>ほとんどの手数料は即座に有効になりますが、{vestingThreshold}を超える手数料（会員権のアップグレードやプレミアムアカウント名の登録費用など）は{vestingPeriod}日間の権利付与期間後に有効になります。</p>\n";

