module.exports = "<h1 id=\"-\">Аккаунты</h1>\n<p>Как Вы могли заметить, эта блокчейн технология требует регистрации имени аккаунта. Это дает множество преимуществ: помимо улучшенной масштабируемости теперь личность и подпись, авторизующая транзакцию, существуют отдельно. На практике это значит, что <em>владение именем аккаунта</em> полностью независимо от возможности <em>распоряжаться его средствами</em>. Более того, оба права (мы называем их <em>разрешениями</em>) можно разделить между произвольным сложным отношением людей (мы называем их <em>полномочиями</em>) с использованием <em>весов</em> и требуемых <em>порогов</em>.</p>\n";

