module.exports = "<h1 id=\"-\">Подписки</h1>\n<p>Аккаунты в BitShares разделены на три группы. Мы решили дать пользователям возможность по желанию обновлять свои аккаунты до подобного VIP статуса, чтобы получать выгоду от сниженных комиссий и дополнительных функций.</p>\n<h2 id=\"-\">Не имеющие подписки</h2>\n<p><em>Обычный</em> аккаунт <em>не имеет членства</em>.</p>\n<h2 id=\"-\">Пожизненная подписка</h2>\n<p>Пожизненные члены получают процентный кэшбэк с каждой комиссии за транзакцию, которую они оплачивают, и имеют право получать реферальный доход от пользователей, которых они регистрируют, или рефереров сети. Пожизненное членство подразумевает единоразовую оплату членского взноса, размер которого определяется комитетом.</p>\n<h2 id=\"-\">Ежегодная подписка</h2>\n<p>Если пожизненное членство - это слишком много для Вас, Вы все так же можете получить кэшбэк за следующий год, приобретя годовое членство за меньший единоразовый взнос, которое продлится только один год.</p>\n<h3 id=\"-\">Разделение Комиссии</h3>\n<p>Каждый раз, когда Ваш реферальный аккаунт оплачивает комиссию за транзакцию, эта комиссия делится между несколькими разными аккаунтами. Часть получает сеть, еще часть получает Пожизненный Член, рефералом которого является аккаунт.</p>\n<p>Регистратором является аккаунт, который оплатил комиссию за транзакцию при регистрации аккаунта в сети. Регистратор должен решить, как разделить оставшуюся комиссию между собой и своими аффилиатами.</p>\n<h3 id=\"-\">Ожидаемые комиссии</h3>\n<p>Оплаченные комиссии разделяются между сетью, реферерами и регистраторами только один раз в определенный интервал обслуживания.</p>\n<h3 id=\"-\">Вестинговые комиссии</h3>\n<p>Большинство комиссий становятся доступны немедленно, но комиссии за переход порога (как при оплате повышения уровня Вашего членства или регистрации премиум-имени аккаунта) должны обрабатываться несколько дней, как это определено комитетом.</p>\n";

