module.exports = "<h1 id=\"-\">Предложенные транзакции</h1>\n<p>Это продвинутая функция Bitshares, доступная из функционала отправки. Она позволяет использовать так называемую мультиподпись. Представьте, что у вас есть всего один аккаунт, но для авторизации транзакции требуется более одного человека. Эта возможность встроена в Bitshares изначально, однако требует наличия определенных знаний и проведения процесса настройки. Если ранее вы не настраивали мультиподпись для своего аккаунта, то вероятнее всего, она вам не нужна.</p>\n";

