module.exports = "<p>[# summary]</p>\n<h3 id=\"-symbol-\">Актив {symbol}</h3>\n<p>{description}</p>\n<p>Выпущен: {issuer}</p>\n<p>[# annual]</p>\n<p>Если пожизненное членство - это слишком много, Вы все равно можете получать {feesCashback}% кэшбэка за следующий год, став годовым подписчиком всего за {price} в год. <img src=\"/images/logo.png\" alt=\"GitHub лого\"></p>\n<p>[# fee-division]</p>\n<h4 id=\"-\">Разделение Комиссии</h4>\n<p>Каждый раз, когда {account} платит комиссию за транзакцию, эта комиссия делится между разными аккаунтами. Сеть забирает долю в {networkFee}%, и Пожизненный Член, рефералом которого является {account}, получает долю в {lifetimeFee}%.</p>\n<p><em>Регистратор</em> – это аккаунт, который заплатил комиссию за регистрацию {account} в сети. Регистратор должен решить, как разделить оставшиеся {referrerTotalFee}% между ним и его собственной <em>Аффилированной Партнерской</em> программой.</p>\n<p>Регистратор {account} а решил отдать {referrerFee}% от суммы комиссии <em>Аффилированному Рефереру</em> и оставить {registrarFee}% от суммы комиссии себе.</p>\n<h4 id=\"-\">Ожидаемые комиссии</h4>\n<p>Комиссии, оплаченные {account}, разделяются только между сетью, реферерами и регистраторами один раз в каждый период обслуживания ({maintenanceInterval} секунд). Следующее время обслуживания {nextMaintenanceTime}.</p>\n<h4 id=\"-\">Вестинговые комиссии</h4>\n<p>Большинство комиссий доступны немедленно, но комиссии за {vestingThreshold} (такие как комиссия за повышение уровня Вашего членства или регистрацию премиум-имени аккаунта) должны ожидать обработки {vestingPeriod} дней.</p>\n";

