module.exports = "<h1 id=\"-\">Привязанные к рынку активы</h1>\n<p>Криптовалюта со свойствами и преимуществами Биткоина, которая способна поддерживать паритет цен с глобально принятой валютой (например, долларом США), может широко использоваться для удобной и устойчивой к цензуре торговли. Это может быть достигнуто с помощью привязанных к рынку активов (market pegged assets – MPA) от BitShares, нового типа свободно торгуемых цифровых активов, чья стоимость привязана к стоимости обычного базового актива посредством контрактов на разницу цен (CFD).</p>\n<p><em>SmartCoin</em> (синоним MPA) – это криптовалюта, которая <em>всегда</em> имеет 100% или более своей стоимости обеспеченной основной валютой BitShares (BTS), на которую она может быть обменена в любой момент, в качестве <em>залога</em> в CFD.</p>\n<p>Такими уникальными MPA делает их независимость от посреднического риска, даже несмотря на то, что они имеют сходство с CFD, подкрепленными залогом. Этого можно достичь с помощью предоставления сети возможности (реализованной как протокол программного обеспечения) самой быть ответственной за обеспечение залога и проведение сделок, как более подробно описано ниже.</p>\n<p>Это подгруппа доступных привязанных к рынку активов:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n";

