module.exports = "<h1 id=\"-bitassets\">Приватизированные BitAssets</h1>\n<p>Приватизированные BitAssets обслуживают тех клиентов, которые хотели бы выпустить актив с привязкой к рынку, но не хотели бы, чтобы заверители публиковали его цены. Вместо этого, когда клиент создает <em>приватизированный</em> bitasset, он может определять набор авторитетов, которые смогут публиковать цену для этого конкретного актива. Эмитент также может определить все виды комиссий, связанных с этим активом, и получать прибыль.</p>\n<p>Эта функция представляет особый интерес для бирж и институтов, которые имеют доступ к ценам в режиме реального времени и хотели бы увеличить видимость и объем.</p>\n";

