module.exports = "<h1 id=\"-\">Эмитированные пользователем активы</h1>\n<p>Помимо вышеупомянутых <em>привязанных к рынку</em> активов, BitShares позволяет отдельным лицам и компаниям создавать и выпускать свои собственные токены для всего, что они только могут себе представить. Потенциальные варианты использования для так называемых эмитированных пользователем активов (User Issued Assets – UIA) не поддаются исчислению. С одной стороны, такие активы можно использовать в качестве обычных входных билетов, хранящихся на мобильном телефоне пользователя, чтобы облегчить вход на концерт. С другой стороны, они могут использоваться для краудфандинга, отслеживания владения или даже для продажи доли компании в форме акций.</p>\n<p>Очевидно, правила, применимые к каждому виду токенов, сильно отличаются и зачастую варьируются в каждой отдельной юрисдикции. Таким образом, BitShares располагает инструментами, которые позволяют эмитентам соответствовать всем применяемым правилам при выпуске активов с тем условием, что регуляторы изначально позволяют такие активы.</p>\n";

