module.exports = "<h1 id=\"-\">Комиссии</h1>\n<p>В экосистеме BitShares каждой операции присваивается <em>индивидуальная</em> комиссия. Эти комиссии могут меняться. Тем не менее, они определяются только одобрением держателей долей, поэтому каждый держатель основного актива BitShares (BTS) имеет право влиять на то, какими эти комиссии должны быть. Если держатели согласятся снизить некую комиссию и консенсус будет достигнут, комиссия будет автоматически снижена блокчейном. Изменения параметров блокчейна предлагаются членами комитета. Этих члены избираются держателями долей и улучшают показатели гибкости и реакции.</p>\n<p>*: Для этих операций требуется Пожизненное Членство!</p>\n";

