module.exports = "<h1 id=\"-bitassets\">Короткая продажа BitAssets</h1>\n<p>Для увеличения Вашего воздействия на BTS и увеличения ликвидности активов BitAssets, таких как USD, EUR, GOLD и др., Вы можете <em>занять</em> этот актив bitAsset у сети и <em>выставить шорт</em>. Здесь мы кратко опишем данную процедуру.</p>\n<h2 id=\"-\">Заём</h2>\n<p>Сеть BitShares способна создавать любое количество каждого актива BitAsset и занимать его субьектам экосистемы при условии предоставления достаточного залога.</p>\n<ul>\n<li><em>расчетная цена</em>: Цена за 1 BTS взятая с внешних бирж.</li>\n<li><em>уровень обеспечивающего залога</em> (MCR): Размер залога, определённый участниками рынка как минимальный</li>\n<li><em>максимальный размер сжатия шорта</em> (MSQR): Установленный участниками рынка размер вынужденной покупки актива медведями по высокому курсу из опасения еще большего его роста</li>\n<li><em>защита от сжатия шорта</em>(SQP): Определяет предельную величину принудительного покрытия позиции </li>\n<li><em>черта марджин колла</em> (CP): Цена, при которой шорт будет принудительно закрыт</li>\n</ul>\n<h3 id=\"-\">Маржин Колл</h3>\n<p>Сеть BitShares способна применять маржин колл к тем позициям, которые не имеют достаточного залогового обеспечения для покрытия одолженных ими bitAssets. Маржин колл будет происходить каждый раз, когда самая высокая ставка окажется меньше, чем <em>цена досрочного выкупа</em> и больше <em>SQP</em>. Маржинальная позиция будет вынуждена продавать своё залоговое обеспечение каждый раз, когда самое высокое предложение на покупку обеспечения окажется меньше, чем цена дострочного выкупа (x/BTS).</p>\n<pre><code>SQP = расчетная цена / MSQR\nцена дострочного выкупа = DEBT / COLLATERAL * MCR\n</code></pre><p>При маржин колле одолженный актив будет куплен на внесенное залоговое обеспечение по рыночной цене вплоть до SQP и позиция будет закрыта. Оставшиеся от залога BTS будут возвращены клиенту.</p>\n<h3 id=\"-\">Погашение</h3>\n<p>Держатели любого bitAsset могут запросить расчет по <em>справедливой цене</em> в любой момент. Расчет закрывает заемные/шорт позиции с самым низким уровнем залогового обеспечения и продает залог для расчета.</p>\n<h2 id=\"-\">Продажа</h2>\n<p>После заёма bitAssets Вы можете свободно продавать их на любых соответствующих рынках по любой цене, какую будет готов заплатить покупатель. После этого шага короткая продажа считается завершенной, и Вы закрыли короткую позицию с этим конкретным bitAsset.</p>\n<h2 id=\"-\">Обновление обеспечивающего залога</h2>\n<p>В любой момент держатель заемной/шорт позиции может изменить обеспечивающий залог в стремлении гибко подстроиться под поведение рынка. Если обеспечивающий залог увеличится, в качестве залога будет заморожено дополнительное количество BTS, тогда как уменьшение обеспечивающего залога потребует выплаты соответствующего количества BitAsset обратно сети.</p>\n<h2 id=\"-\">Покрытие</h2>\n<p>Чтобы закрыть заемную/шорт позицию нужно обладать одолженным количеством этого конкретного bitAsset, дабы передать его сети BitShares. После этого BitAssets снимаются с соответствующего баланса, а залог освобождается и отправляется обратно владельцу.</p>\n";

