module.exports = "<h1 id=\"-\">Резервные копии</h1>\n<h2 id=\"-\">Локальный кошелек</h2>\n<p>Мы настоятельно рекомендуем Вам регулярно создавать резервные копии Вашего локального кошелька несмотря на то, что одной резервной копии в большинстве случаев оказывается достаточно. Пожалуйста, обратите внимание, что для восстановления из резервной копии будет необходимо предоставить фразу-пароль (пароль), так как <strong>резервные копии зашифрованы</strong>. Следовательно, если Вы потеряете кошелек или Вашу фразу-пароль, то больше никогда не сможете получить доступ к своим средствам!</p>\n<p>Вы можете создать резервную копию из меню <a href=\"/settings\">Настройки -&gt; Резервная копия</a>.</p>\n<ul>\n<li>Храните свою резервную копию по крайней мере в двух местах, доступных только вам</li>\n<li>Резервная копия зашифрована вашим паролем, поэтому не храните пароль в том же самом месте</li>\n</ul>\n<h2 id=\"-\">Только для опытных пользователей</h2>\n<h3 id=\"brainkey\">Brainkey</h3>\n<blockquote>\n<p>Если Вы никогда не импортировали ключ аккаунта в свой кошелек вручную, Вы также можете создать резервную копию Вашего аккаунта и принадлежащих ему средств, экспортировав <em>brainkey</em> – цепочку слов, из которой Ваши ключи извлекаются детерминированно.</p>\n</blockquote>\n<p>Примечание: Иерархическое управление (ТОЛЬКО для опытных пользователей)</p>\n<blockquote>\n<p>Если Вы используете иерархическое управление (разрешения аккаунта/активные разрешения), создания резервной копии одних только ключей может быть недостаточно для восстановления доступа к Вашим средствам! Пожалуйста, ознакомьтесь с документацией об иерархическом управлении.</p>\n</blockquote>\n";

