module.exports = "<h1 id=\"bitshares\">BitShares</h1>\n<h2 id=\"-\">Поддержка</h2>\n<blockquote>\n<p>Если у Вас возникли проблемы со шлюзом от провайдера, пожалуйста, свяжитесь с ним напрямую. Смотрите список шлюзов в левом меню.</p>\n</blockquote>\n<h3 id=\"-bitshares\">Чат Bitshares</h3>\n<p>Вы можете общаться с другими членами сообщества Bitshares в реальном времени здесь:</p>\n<ul>\n<li><a href=\"https://t.me/BitSharesDEX_RU\">Telegram</a></li>\n<li><a href=\"https://discord.gg/GsjQfAJ\">Discord</a></li>\n</ul>\n<h3 id=\"-\">Разработчики</h3>\n<p>Если вы являетесь разработчиком программного обеспечения, то можете поучаствовать в баунти-программе здесь:</p>\n<ul>\n<li><a href=\"https://github.com/bitshares/bitshares-ui\">Github UI</a></li>\n<li><a href=\"https://github.com/bitshares/bitshares-core\">Github Core</a> </li>\n</ul>\n<h2 id=\"-\">Введение</h2>\n<p>Добро пожаловать на самую быструю в мире децентрализованную биржу (The DEX). BitShares создан для того, чтобы распространить инновационность технологии блокчейн во все индустрии, которые используют интернет для предоставления своих услуг. Банки ли это, или фондовые биржи, лотереи, голосование, музыка, аукционы и многие другие сферы, публичный цифровой реестр позволяет создавать децентрализованные автономные компании (т.н. DAC), которые предоставляют сервисы лучшего качества за меньшие деньги в сравнении с их более традиционными централизованными коллегами. Появление таких децентрализованных компаний возвещает о появлении в организационной структуре новой парадигмы, в которой компании могут работать без управления человеком и под контролем не подверженного коррупции набора правил ведения бизнеса. Эти правила закодированы в публично проверяемом программном обеспечении с открытым исходным кодом, распространенном на компьютерах держателей долей компании, которые без особых усилий защищают компанию от произвольного захвата контроля.</p>\n<p>BitShares делает для бизнеса то, что Биткоин сделал для денег, используя технологию распределенного консенсуса для создания компаний, которые по своей сути глобальны, прозрачны, надежны, эффективны и, что не менее важно, прибыльны.</p>\n<h2 id=\"-\">Кошелек</h2>\n<p>Этот кошелек обеспечивает доступ к большинству функций сети BitShares, включая</p>\n<ul>\n<li><a href=\"/help/assets/mpa\">BitAssets (БитАктивы)</a></li>\n<li><a href=\"/help/assets/uia\">Выпущенные пользователем активы</a></li>\n<li><a href=\"/help/dex/introduction\">Биржу DEX</a></li>\n</ul>\n";

