module.exports = "<h1 id=\"-\">Блокчейн</h1>\n<p>Как и большинство криптовалют, для оповещения участников о транзакциях и происходящем на рынке протокол Графен использует технологию блокчейн. Так как блок всегда ссылается на предыдущий блок, мы получаем цепь блоков (блокчейн), которая содержит все когда-либо произведенные в сети транзакции. Так как блокчейн – это публично доступный и проверяемый реестр, любой желающий может детально просмотреть и проверить транзакции, а также рыночные ордера и биржевые стаканы.</p>\n<p>Конечно, этот веб-кошелек предлагает Вам обозреватель блоков, дабы помочь Вам с аудитом.</p>\n<h2 id=\"-\">Механизм консенсуса</h2>\n<p>То, кому именно и в какое время будет позволено <em>произвести</em> блок, определяется механизмом консенсуса под названием <em>Делегированное доказательство владения долей</em>. По сути, держатели долей BitShares (держатели токена BTS) могут голосовать за предпочитаемых ими производителей блоков в блокчейне. Этим так называемым <em>делегатам</em> с наибольшим количеством голосов и позволяется производить блоки.</p>\n<h2 id=\"-\">Транзакции</h2>\n<p>Блокчейн-технология Графен предлагает Вам различные типы транзакций. Пользователи могут не только просто переводить активы друг другу, но и пользоваться транзакциями для взаимодействия с децентрализованной биржей. Большая часть этих типов транзакций помечена поясняющим флагом, другие же требуют некоторых познаний в механизмах внутреннего функционирования компании.</p>\n";

