module.exports = "<h2 id=\"-\">Сервисы моста и шлюза</h2>\n<p>И мосты, и шлюзы позволяют Вам заводить и выводить монеты, однако существует разница в уровне доверия, которое Вам нужно будет оказать поставщикам этих сервисов.</p>\n<h3 id=\"-\">Мосты: модель без доверия</h3>\n<p>Сервис моста предоставляет Вам способ завести некоторое количество криптовалюты, помимо BitShares, и получить взамен эквивалент в SmartCoin. SmartCoins не подвержены посредническому риску, поэтому единственный риск, с которым Вы сталкиваетесь при использовании моста, это тот короткий момент времени, который нужен на завершение трансфера. Это лучше, чем централизованная биржа вроде Poloniex, на которой Вы всегда находитесь под риском взлома биржи, ее банкротства, или других подобных проблем.</p>\n<h3 id=\"-\">Шлюзы: модель на основе доверия</h3>\n<p>Шлюзы по сути являются аналогом стандартной модели биржи, где Вы зависите от платежеспособности биржи, которая должна выкупить Ваши монеты. В основном шлюзы выпускают активы с собственным символом в префиксе, например, TRADE или META. Эти активы на 100% обеспечены реальными BTC или ETH, либо же любой другой валютой, которую люди заводят через шлюзы.</p>\n<p>Таким образом, OPEN.BTC теоретически эквивалентны BTC, которые Вы получаете на Poloniex, которые могут иметь префикс POLO.BTC. В обоих случаях Вы полагаетесь на поставщика сервиса: CCEDK для OPEN. assets и Poloniex для POLO. assets, которые должны оставаться платежеспособными, дабы обеспечивать ценность выпущенных ими активов. Так как шлюзы предоставляют только один сервис, который обычно является частью работы биржи, кто-нибудь даже может сказать, что их работа по обеспечению своих средств довольно легкая.</p>\n";

