module.exports = "<h1 id=\"-\">Кошелек</h1>\n<p>Как Вы уже могли заметить, это веб-приложение, которое работает в браузере. Соединение устанавливается с доверенным узлом сети, который служит шлюзом в остальную часть экосистемы.</p>\n<h2 id=\"-\">Облачный кошелек (Модель &quot;аккаунт&quot;)</h2>\n<p>Если Вы зарегистрировались с использованием имени пользователя и пароля, Вы обладаете облачным кошельком. И хотя технически ничего не хранится в облаке, мы используем термин Облачный кошелек, потому что Вы можете использовать эти данные (имя пользователя и пароль) для получения доступа к своему аккаунту из любого веб-браузера в любой момент. Облачный кошелек позволяет получить доступ только к одному аккаунту за раз. Обычно это является оптимальным вариантом для новых пользователей. Несмотря на то, что автоматически сгенерированный пароль можно изменить, мы не рекомендуем делать это прямо сейчас. Наша команда работает над надежным способом смены пароля, который не потребует технических знаний. Мы объявим о его появлении, как только он будет готов.</p>\n<h2 id=\"-\">Локальный кошелек (Модель &quot;кошелек&quot;)</h2>\n<p>Локальный кошелек создает базу данных в рамках Вашего браузера. Это означает, что доступ к Вашим средствам привязан <strong>только к этому браузеру</strong>. Если Вы попытаетесь получить доступ к своему локальному кошельку с любого другого компьютера или браузера, Вам это не удастся, если только Вы не проведете активный импорт файла резервной копии из файла резервной копии оригинального браузера. На самом деле этот процесс очень прост. Смотрите информацию об управлении <a href=\"/help/introduction/backups\">резервными копиями</a>.</p>\n<h2 id=\"-\">Безопасность</h2>\n<p>Будьте уверены, что наши сервера никогда не получат доступа к Вашим средствам, потому как ни один из Ваших приватных ключей никогда не покидает браузер. Вместо этого они зашифрованы с помощью Вашей фразы-пароля и хранятся в локальной базе данных Вашего браузера. Поэтому Вам обязательно нужно иметь актуальную <a href=\"/help/introduction/backups\">резервную копию</a> на случай повреждения Вашего компьютера или браузера.</p>\n<h2 id=\"-\">Управление</h2>\n<p>Пользовательский интерфейс способен содержать и предоставлять доступ к нескольким кошелькам, каждый из которых может содержать несколько аккаунтов и соответствующие им средства. Вы можете добавлять, создавать резервную копию и переключаться между существующими кошельками в меню <code>Настройки-&gt;Кошельки</code>.</p>\n";

