module.exports = "<h1 id=\"-\">Делегат</h1>\n<p>Делегаты - это единицы, которые работают на блокчейн, создавая новые блоки. Каждый делегат утвержден держателями долей; он создает и подписывает блоки с действительными транзакциями. Каждая совершенная в сети транзакция должна в конечном итоге быть подтверждена всеми делегатами.</p>\n<h2 id=\"-\">Механизм консенсуса</h2>\n<p>То, кому именно и в какое время будет позволено <em>произвести</em> блок, определяется механизмом консенсуса под названием <em>Делегированное доказательство владением долей</em>. По сути, держатели долей BitShares (держатели токена BTS) могут голосовать за предпочитаемых ими производителей блоков в блокчейне. Этим так называемым <em>делегатам</em> с наибольшим количеством голосов и позволяется производить блоки.</p>\n";

