module.exports = "<h1 id=\"-\">Работники</h1>\n<p>Работники состоят из предложений по выполнению услуг в обмен на зарплату от блокчейна. Предложение о работе как минимум содержит следующую информацию:</p>\n<ul>\n<li>Даты начала и окончания</li>\n<li>Размер ежедневной выплаты</li>\n<li>Максимальную итоговую выплату</li>\n</ul>\n<p>Оно также должно содержать ссылку на страницу, где предложение о работе описывается детально.</p>\n<p>Голоса за предложение о работе могут быть как положительными, так и отрицательными, что означает, что Вы можете проголосовать против предложения о работе, которое Вам не нравится.</p>\n<h2 id=\"-\">Механизм бюджета работника</h2>\n<p>Работники получают оплату из фиксированного ежедневного бюджета по принципу кто раньше пришел - того раньше обслужили, до тех пор, пока средств больше не останется. Чтобы понять, как это работает, давайте представим следующее:</p>\n<ul>\n<li>Ежедневный общий бюджет составляет 400 000 BTS на всех работников</li>\n<li>Есть 5 предложений о работе с положительным количеством голосов и запросом на ежедневную оплату в размере 100 000 BTS каждое</li>\n</ul>\n<p>Тогда четыре работника с наибольшим количеством голосов получат по 100 000 BTS в день каждый, но как только они получают выплаты, бюджет остается пустым. Следовательно, пятый работник ничего не получит.</p>\n";

