module.exports = "<h1 id=\"-\">Голосование</h1>\n<blockquote>\n<p>Голосование столь же важно для экосистемы Bitshares, как и для сообщества, в котором вы живете. Вес вашего голоса прямо пропорционален количеству токенов BTS, которыми вы владеете. Если вы не слишком вовлечены в жизнь сообщества, то можете выбрать прокси (представителя), который будет представлять ваши интересы. Если же вы хотите участвовать в происходящем, зайдите на эти <a href=\"/help/introduction/bitshares\">каналы</a>.</p>\n</blockquote>\n<h2 id=\"-\">Прокси</h2>\n<p>Вы можете <strong>не</strong> проявлять активность в вопросах управления Bitshares. Если вы решили так поступить, важно, чтобы вы выбрали кого-либо из членов сообщества Bitshares в качестве прокси. Это дает им полномочия голосовать от вашего имени, тогда как ваша доля BTS обеспечивает силу их голоса. Это схоже с выбором официального представителя.</p>\n<h2 id=\"-\">Заверители</h2>\n<p>Заверители – это единицы, которые работают на блокчейн, создавая новые блоки. Их роль схожа с ролью майнеров в Биткоине и других блокчейнах. Каждый заверитель утвержден держателями долей; он создает и подписывает блоки с проверенными транзакциями. Каждая совершенная в сети транзакция должна в конечном итоге быть подтверждена всеми заверителями.</p>\n<h3 id=\"-\">Механизм консенсуса</h3>\n<p>То, кому именно и в какое время будет позволено <em>произвести</em> блок, определяется механизмом консенсуса под названием <em>Делегированное доказательство владения долей</em>. По сути, вы как держатель долей BitShares (держатель токена BTS) можете голосовать за предпочитаемых производителей блоков в блокчейне. Этим так называемым <em>заверителям</em> с наибольшим количеством голосов и позволяется производить блоки.</p>\n<h2 id=\"-\">Комитет</h2>\n<p>Комитет – это набор единиц, утвержденных держателями долей и задающих политику блокчейна Bitshares, включая:</p>\n<ul>\n<li>комиссии за транзакции и торговлю</li>\n<li>параметры блокчейна, такие как размер блока, интервал блока и т.п.</li>\n<li>реферальные и вестинговые параметры, такие как процент кэшбэка и вестинговые периоды.</li>\n</ul>\n<h2 id=\"-\">Работники</h2>\n<p>Работники представляют собой предложения по предоставлению услуг в обмен на зарплату от самого блокчейна. Рабочее предложение содержит как минимум следующую информацию:</p>\n<ul>\n<li>Даты начала и окончания</li>\n<li>Размер ежедневной выплаты</li>\n<li>Максимальную итоговую выплату</li>\n<li>Ссылку на страницу поста, где объясняется цель конкретного рабочего предложения.</li>\n</ul>\n<h3 id=\"-\">Жизненный цикл работников</h3>\n<h4 id=\"-\">Предложенные</h4>\n<p>Такие рабочие предложения были внесены в блокчейн, и по ним идет активное голосование. Чтобы они стали активными, итоговое количество отданных за них голосов должно превысить таковое у работника refund400k.</p>\n<h4 id=\"-\">Активные</h4>\n<p>Такие рабочие предложения преодолели минимальный порог и активно получают выплаты. Активные работники теряют финансирование, если общее количество отданных за них голосов опускается ниже уровня работника refund400k.</p>\n<h4 id=\"-\">Истекшие</h4>\n<p>Такие рабочие предложения отображаются только для истории. Вы найдете завершенные рабочие предложения по дате их окончания.</p>\n<h3 id=\"-\">Механизм функционирования рабочего бюджета</h3>\n<p>Работники получают оплату из фиксированного ежедневного бюджета по принципу кто раньше пришел – того раньше обслужили, до тех пор, пока средств больше не останется. Чтобы понять, как это работает, давайте представим следующее:</p>\n<ul>\n<li>Ежедневный бюджет составляет 400 000 BTS на всех работников</li>\n<li>Есть 5 рабочих предложений с положительным количеством голосов и запросом на ежедневную оплату в размере 100 000 BTS каждое</li>\n</ul>\n<p>Тогда четыре работника с наибольшим количеством голосов получат по 100 000 BTS в день каждый, но как только они получают выплаты, бюджет остается пустым. Следовательно, пятый работник ничего не получит.</p>\n";

