module.exports = "<h1 id=\"-yelik\">Üyelik</h1>\n<p>BitShares&#39;deki hesaplar üç gruba ayrılırlar . Biz kullanıcılara dilerlerse hesaplarını VIP\ngibi bir statüye yükseltmelerine ve ilave özelliklerden ve indirimlerden \nfaydalanmalarına imkan tanıdık.</p>\n<h2 id=\"-ye-olmayanlar\">Üye-Olmayanlar</h2>\n<p><em>Normal</em>  hesap <em>üye-olmayan</em> bir hesaptır.</p>\n<h2 id=\"-m-r-boyu-yeler\">Ömür-boyu Üyeler</h2>\n<p>Ömür-boyu-üyelerinin ödediği her işlem ücretinin belirli bir yüzdesi kendilerine iade \nedilir ve kaydını yaptıkları ya da getirdikleri üyelerden komisyon geliri kazanmaya \nhak kazanırlar. Ömür-boyu-üyelikle alakalı kurul tarafından belirlenmiş belli miktarda \ntek-seferlik bir ücret vardır.</p>\n<h2 id=\"y-ll-k-yeler\">Yıllık Üyeler</h2>\n<p>Ömür-boyu-üyelik eğer çok fazla gelirse , bir yıl süreli tek-seferlik düşük bir bedel \nkarşılığında yıllık abone olarak bir sonraki seneye de aynı iadeyi \nalabilirsiniz.</p>\n<h3 id=\"-cret-payla-m-\">Ücret Paylaşımı</h3>\n<p>Getirdiğiniz hesap her işlem ücreti ödediğinde o ücret birçok farklı hesap arasında \npay edilir. Ağımız bir kısmını alır , hesabı getiren ömür-boyu-üye de diğer kısmını alır.\nHesabı getiren üye bir kısım pay alır.</p>\n<p>Kayıtçı , hesabın ağımıza kaydı yapılırken işlem ücretini ödeyen hesaptır. Kayıtçı \nücretin geri kalan kısmını kendisi ve bağlantılarıyla nasıl pay edeceğine kendisi karar \nverir.</p>\n<h3 id=\"bekleyen-cretler\">Bekleyen Ücretler</h3>\n<p>Ödenen ücretler sadece ağımız, getirenler, ve kayıtçılar arasında her bakım aralığında \nbir kez pay edilir.</p>\n<h3 id=\"hak-edilen-cretler\">Hak Edilen Ücretler</h3>\n<p>Çoğu ücretler anında ödenmesine rağmen , bir limitin üzerindeki ücretler (mesela \nüyeliğinizi yükseltmek için ödediğiniz ya da paralı hesap kaydetmek için ödediğiniz \nücretler) kurul tarafından belirlenen bir kaç gün boyunca haciz altında tutulabilirler.</p>\n";

