module.exports = "<h1 id=\"i-zinler\">İzinler</h1>\n<p>BitShares&#39;de , her hesap ikiye ayrılır </p>\n<ul>\n<li><strong>Etkin  İzin</strong>: fonların yönetimi ve</li>\n<li><strong>Sahip İzni</strong>: hesap yönetimi.</li>\n</ul>\n<p>Her ikisi de hesabınızın <code>İzinler</code> sekmesinde <em>yetkiler</em> ve <em>alt-sınır</em>&#39;ın birlikte \nkullanılmasıyla belirlenebilir. İşlemin geçerli olması için <em>alt-sınır</em> ın geçilmesi \ngerekmektedir.</p>\n<h2 id=\"yetkililer\">Yetkililer</h2>\n<p>BitShares&#39;de bir <em>yetkili</em>,  transfer veya alım-satım gibi işlemlere yetki veren bir veya \ndaha çok sayıda kişiden oluşur.</p>\n<p>Bir yetki , bir yada daha fazla sayıda hesap adı ve <em>ağırlık</em> \nçiftinden oluşur.</p>\n<p>Geçerli bir işlem elde edebilmek için , imzalayan tarafların etki ağırlıklarının toplamı \nizinlerde belirlenmiş olan alt-sınırı geçiyor olması gerekir.  </p>\n<h1 id=\"-rnekler\">Örnekler</h1>\n<p>Birkaç örneğe bakarak kullanılan terminolojiye ve kullanım senaryolarına ışık tutalım. \nAşağıda tanımlanmış etkin izinlerle yeni bir hesap oluşturulduğunu farz edelim. \nDikkatinizi çekeriz , aynı şema sahip izinleri için de \nişe yarar. </p>\n<h2 id=\"-d-z-ok-i-mzal-\">(Düz) Çok-İmzalı</h2>\n<p>Düz çok-imzalı bir şema, işlemin geçerli olabilmesi için aralarından &#39;N&#39; sayıda kişinin \nimzası gerekli  toplam &#39;M&#39; sayıda kişiden oluşur. Şimdi biz, BitShares&#39;de, &#39;M&#39; \nve &#39;N&#39; yerine <em>ağırlıklar</em> ve <em>alt-sınır</em>  kullanıyoruz. Şimdi göreceğimiz gibi tamamen \naynı sonuca çok daha esnek bir şekilde varacağız.  </p>\n<p>Gelin şöyle farz edelim , Alice, Bob, Charlie ve Dennis&#39;in ortak fonları olsun . \nEğer yalnızca ikisi anlaşırlarsa geçerli olabilecek bir işlem oluşturmak istiyoruz .\nDolayısıyla <strong>4-ün-2-si</strong> (M-in-N-i) şeması şöyle görünür : </p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Ağırlık</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Alice</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Sınır :</td>\n<td>51%</td>\n</tr>\n</tbody>\n</table>\n<p>Katılımcıların her birinin 33% etki ağırlığı var fakat alt sınır 51%  olarak ayarlanmış.\nDolayısıyla  işlemi geçerli kılmak için 4 kişiden sadece 2 sinin anlaşması yeterlidir.</p>\n<p>Alternatif olarak, bir 4-ün-3&#39;ü şeması oluşturmak için ya ağırlıkları 17% ye indirebiliriz \nyada alt-sınırı 99%&#39;a yükseltebiliriz. </p>\n<h2 id=\"-d-z-esnek-ok-i-mzal-\">(Düz) Esnek Çok-İmzalı</h2>\n<p>Alt-sınır ve ağırlıklar sayesinde fonlarımızla şimdi daha esneğiz, yada daha doğrusu \ndaha fazla <em>hakimiyetimiz</em> var. Mesela , farklı kişiler için ayrı ağırlıklar belirleyebiliriz.\nFarzedelim ki Alice fonlarını çoklu-imza şeması kullanarak hırsızlığa karşı korumak \nistiyor fakat aynı zamanda arkadaşlarına da gereğinden fazla hakimiyet teslim etmek \nistemiyor. O zaman şuna benzer bir yetki oluşturuyoruz :</p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Ağırlık</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Alice</td>\n<td>49%</td>\n</tr>\n<tr>\n<td>Bob</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Charlie</td>\n<td>25%</td>\n</tr>\n<tr>\n<td>Dennis</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Sınır :</td>\n<td>51%</td>\n</tr>\n</tbody>\n</table>\n<p>Şimdi, fonlara Alice tek bir arkadaşıyla yada  tüm üç arkadaşıyla birlikte erişebilme \nimkanına sahip olur.</p>\n<h2 id=\"-ok-basamakl-esnek-oklu-i-mza\">Çok-Basamaklı Esnek Çoklu-İmza</h2>\n<p>Gelin beraber basit bir çok-basamaklı anonim hesap kurulumuna göz atalım. Mali İşler \nMüdürü (MİM) ve onun için altında çalışan Vezne, Denetçi, Vergi Müdürü, Muhasebe vb. gibi \ndepartmanları olan bir şirkete bakıyor olalım.  Bir de harcama ayrıcalıklarına sahip\nolmayı  isteyen bir CEO&#39;su olsun. \nO zaman biz fonlar için şunlara göre bir yetki oluştururuz :</p>\n<table>\n<thead>\n<tr>\n<th>Hesap</th>\n<th>Ağırlık</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>CEO.ŞİRKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>MİM.ŞİRKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>----------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt Sınır :</td>\n<td>51%</td>\n</tr>\n</tbody>\n</table>\n<p>burada CEO.ŞİRKET ve MİM.ŞİRKET in kendilerine ait ayrı yetkileri var.  Mesela \nMİM.ŞİRKET hesabı şöyle olabilir :</p>\n<table>\n<thead>\n<tr>\n<th>MİM.ŞİRKET</th>\n<th>Ağırlık</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Müdür.ŞİRKET</td>\n<td>51%</td>\n</tr>\n<tr>\n<td>Vezne.ŞİRKET</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Denetçi.ŞİRKET</td>\n<td>33%</td>\n</tr>\n<tr>\n<td>Vergi Müdürü.ŞİRKET</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>Muhasebe.ŞİRKET</td>\n<td>10%</td>\n</tr>\n<tr>\n<td>-------------------</td>\n<td>------</td>\n</tr>\n<tr>\n<td>Alt-sınır :</td>\n<td>51%</td>\n</tr>\n</tbody>\n</table>\n<p>Bu şema fonların harcanabilmesi için  kişilere şöyle izinler verir :</p>\n<ul>\n<li>CEO  tek başına</li>\n<li>Mali İşler Müdürün tek başına </li>\n<li>Vezne ve Denetçi birlikte</li>\n<li>Denetçi veya Veznedar , Vergi Müdürü ve Muhasebeciyle birlikte \nharcama.</li>\n</ul>\n<p>Dolayısıyla görüldüldüğü gibi yetkilendirmeleri gelişigüzel derinlikte yayarak her türlü \niş alanına uyacak esneklikte uygulamak mümkün.</p>\n";

