module.exports = "<h1 id=\"piyasa-sabitli-aktifler-mpa-market-pegged-assets-\">Piyasa Sabitli Aktifler (MPA-Market Pegged Assets)</h1>\n<p>Bitcoin&#39;e benzeyen özelliklerde ve avantajlarda, amerikan Doları gibi tüm dünya\ntarafından benimsenmiş bir parayla pariteyi koruyabilen bir kripto-paranın\n sansürsüz ve kolay bir ticaret için çok faydası vardır. Bu, BitShares&#39;in \npiyasaya  sabitli varlıkları (MPA) sayesinde mümkün olur. Bunlar, serbestçe \nalıp-satılabilen yeni  bir tür dijital varlıklardır. Bunların değerleri, fark-kontratı (CFD) yöntemiyle\ndayandıkları geleneksel varlıkların değerlerini takip etmek üzere dizayn edilmişlerdir. </p>\n<p><em>AkıllıPara</em> (eşanlamı MPA) , değerinin  <em>daima</em>  100% yada daha fazlası BitShares&#39;in \n ana para birimi (BTS) ile desteklenen bir kripto-paradır. Bu <em>AkıllıParalar</em> herhangi bir \nzamanda bir fark-kontratı (CFD) içinde <em>teminat</em> olarak BTS&#39;ye dönüştürülebilirler .</p>\n<p>Teminatla desteklenen FK&#39;nı andırmalarına rağmen PSV&#39;leri nadir yapan şey \nonların  karşı taraf riskinden muaf olmalarıdır. Bunun mümkün olması için teminatı \ngüvence  altına alma ve hesap görme işlemleri ağın  kendi sorumluluğuna bırakılmıştır<br>(yazılım protokolüyle uygulanarak) . Bu konunun detayları aşağıda\nanlatılacaktır.</p>\n<p>Bu, piyasaya-sabitli-varlıkların mevcut bir alt kümesidir:</p>\n<ul>\n<li>BitUSD</li>\n<li>BitCNY</li>\n<li>BitEUR</li>\n<li>BitGOLD</li>\n<li>...</li>\n</ul>\n";

