module.exports = "<h1 id=\"bitaktif-k-sa-sat-\">BitAktif Kısa Satışı</h1>\n<p>BTS&#39;le temasınızı arttırmak ve USD,EUR,GOLD gibi BitAktiflere likidite sağlamak için \nbu BitAktifleri ağdan <em>ödünç</em> alabilir ve <em>kısa satabilirsiniz</em>. Prosedürü burada kısaca \nanlatacağız.</p>\n<h2 id=\"-d-n-alma\">Ödünç Alma</h2>\n<p>BitShares ağının herhangi bir miktarda BitVarlığı piyasaya sürmesi ve yeterli teminat \nkarşılığında katılımcılara borç vermesi mümkündür. </p>\n<ul>\n<li><em>uzlaşma fiyatı</em> : 1 BTS in dış borsalarda alıp-satılırkenki fiyatı.</li>\n<li><em>idame teminat oranı</em> (MCR) :  zorunlu minimum teminat oranı </li>\n<li><em>maksimum kısa sıkıştırma oranı</em> (MSQR) : Tanıklar tarafından kısaların kısa sıkıştırmalara karşı nereye kadar korunacaklarını belirleyen oran.</li>\n<li><em>kısa sıkıştırmadan korunma</em> (SQP) : Marjin pozisyonuna ödettirilebilecek en yüksek  </li>\n<li><em>çağrı fiyatı</em> (cp):   Kısa/ödünç pozisyonlarının marjin çağrıldığı fiyat.  </li>\n</ul>\n<h3 id=\"marjin-a-r-s-teminat-tamamlama-a-r-s-\">Marjin Çağrısı ( Teminat Tamamlama Çağrısı)</h3>\n<p>BitShares ağı , ödünç aldığı bitVarlığın karşılığında yeterince teminatı bulunmayan \npozisyonları teminatı tamamlamaları için çağırabilir. Marjin çağrısı , en yüksek alış fiyat \nteklifinin <em>çağrı fiyatından</em> az , ve <em>SQP</em> dan büyük olduğu herhangi bir anda \nmeydana gelebilir.\nMarjin pozisyonu, teminatı satın almaya verilen en yüksek teklifin çağrı \nfiyatından(x/BTS) daha düşük olduğu anda teminatı zorla sattırılır.</p>\n<pre><code>SQP =  uzlaşma fiyatı / MSQR\nçağrı fiyatı = BORÇ / TEMİNAT * MCR\n</code></pre><p>Marjin çağrısı teminatı alır , ödünç alınmış bitaktif hisselerinin SQP ya kadarki kısmını\npiyasa fiyatından satın alır ve pozisyonu kapar. Teminattan geri kalan BTS müşteriye \niade edilir.</p>\n<h3 id=\"hesap-g-rme\">Hesap görme</h3>\n<p>Her bitaktif sahibi istediği zaman <em>adil bir fiyattan</em> hesap görmeyi talep edebilir.\nHesap görme işlemi, ödünç/kısa pozisyonlarını en düşük teminat oranıyla kapar ve \nhesap görmek üzere teminatı satar.</p>\n<h2 id=\"sat-\">Satış</h2>\n<p>BitAktif ödünç alındıktan sonra alakalı piyasalardan herhangi birinde herhangi\nbir fiyattan satılabilir . Bu aşamayla ,  kısa-satış tamamlanmış olur ve o bitaktif da kısa \nolursunuz.</p>\n<h2 id=\"teminat-oran-n-g-ncellemek\">Teminat Oranını Güncellemek</h2>\n<p>Ödünç/kısa pozisyonu tutan kişi , herhangi bir zamanda , piyasa \ndavranışını esnek bir biçimde ayarlamak için teminat oranını değiştirebilir. Eğer \nteminat oranı arttırılırsa , ilave miktarda BTS teminat olarak kilit altına alınır, teminat \noranının düşürülmesi ise tekabül eden miktarda BitVarlığın ağa geri ödenmesini \ngerektirir.</p>\n<h2 id=\"kapamak\">Kapamak</h2>\n<p>Ödünç/kısa pozisyonunu kapamak için , ilk önce kişinin , BitShares ağına teslim \netmek üzere o Bitvarlığın ödünç alınan miktarda elinde bulunması gerekir. Ondan \nsonra , BitAktifler arz stoğundan düşer ve teminat serbest bırakılıp sahibine geri \nverilir.</p>\n";

