module.exports = "<h1 id=\"al-sat-\">Alış-Satış</h1>\n<p>Bu sayfa DEX (dağıtık borsa)de kullanılan terimlerin nasıl yorumlanması gerektiği \nve al-sat eşlerinin nasıl temsil edildiğine dair hızlı bir giriştir.</p>\n<h2 id=\"-iftler-e-ler\">Çiftler/Eşler</h2>\n<p>BitShares&#39;de , neredeyse her aktif tüm diğer aktiflerle alınıp-satılabilirler. İki varlık \nseçmiş olduğumuz vakit , biz genelde <em>piyasa çifti</em> diye hitab ediyoruz. Mesela , \nUSD&#39;yi EUR&#39;a karşı  USD:EUR çiftinde takas edebiliriz.</p>\n<p>Tutarlı olmak adına , biz <em>temel</em> ve <em>kota</em> genel terimlerini kullanacağız ,\nöyleki çiftler şöyle temsil edileceklerdir </p>\n<pre><code>*kota* : *temel*\n</code></pre><p>ve mesela <em>temel</em> USD olursa ve <em>kota</em> da EUR olursa biz  bunu EUR:USD çifti olarak \nbelirteceğiz</p>\n<h2 id=\"sipari-defterleri\">Sipariş Defterleri</h2>\n<p>Sipariş defteri <em>ask</em> (istenilen satış fiyatı) ve <em>bid</em> (verilen alış teklif fiyatı) yanlarından \noluşur. Alış-satış çiftlerin tercihen bir yönü olmadığından ters çevirilebilirler, aşağıdaki \ntabloda ask/bid ve her iki tarafın ilgili al/sat operasyonlarına genel bakış verilmiştir:</p>\n<table>\n<thead>\n<tr>\n<th>Taraf</th>\n<th>Sat</th>\n<th>Al</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>Ask</td>\n<td><em>kota</em></td>\n<td><em>temel</em></td>\n</tr>\n<tr>\n<td>Bid</td>\n<td><em>temel</em></td>\n<td><em>kota</em></td>\n</tr>\n<tr>\n<td>----------</td>\n<td>-------</td>\n<td>-------</td>\n</tr>\n</tbody>\n</table>\n<p>USD:EUR çiftinin bid tarafında olan EUR:USD çiftinin ask tarafında \nolacaktır. Tabiiki  fiyatlar kesir olarak temsil edileceğinden sonuçta her iki çift aynı \nolacaktır.</p>\n<h2 id=\"al-sat-\">Alış-Satış</h2>\n<p>Al-sat emri vermek için , formun taraflarından birini doldurmak \ngereklidir,  ya <em>ask</em>, yada <em>bid</em> tarafı ( <em>al</em> yada <em>sat</em> tarafı) . Satmak/almak için bir \n<em>fiyat</em> ve bir <em>miktar</em> belirlemeniz gerekecektir. Bu emrin maliyeti otomatik olarak \nhesaplanacaktır. \nBu emrin verilmesi için ilave ücret gerekecektir.</p>\n<p>Emir icra edildiğinde (biri teklifinizi sattığında/aldığında) , hesabınıza söz konusu \nvarlıktan yatırılacaktır.</p>\n<p>Yerine getirilmemiş emirler herhangi bir zamanda iptal edilebilirler.</p>\n";

