module.exports = "<h1 id=\"yedeklemer\">Yedeklemer</h1>\n<p>Çoğu zaman tek bir yedekleme yeterli olsa bile cüzdanınızı düzenli bir şekilde \nyedeklemeniz önerilir. Bir yedeklemeden geri kurtarma yapabilmek için şifre \ncümlenize ihtiyacınız olduğunu unutmayın , çünkü <strong>yedeklemeler kriptolanmıştır</strong>. \nDolayısıyla , cüzdanınızı yada şifre cümlenizi kaybederseniz fonlarınıza tekrar \nerişmeniz imkansız olur.</p>\n<p>Yedeklere Cüzdan Yönetim Panelinden ulaşabilirsiniz . \n(<code>Ayarlar -&gt;Cüzdanlar</code>).</p>\n<h2 id=\"c-zdan-i-hrac-\">Cüzdan İhracı</h2>\n<p>Yeni bir yedekleme oluşturmanın en kolay yolu Cüzdan Yönetim Panelinde\nverilen bağlantıdan cüzdanı dışarı ihrac etmektir. Lütfen yedeklerinizi güvenli bir \nkaybetmekten, hırsızlıklardan, ve doğal afetlerden koruyunuz. </p>\n<h2 id=\"beyin-anahtar-yalnizca-geli-mi-kullan-c-lar-\">Beyin-anahtarı (YALNIZCA gelişmiş kullanıcılar )</h2>\n<p>Eğer cüzdanınızın içine hiç hesap anahtarı aktarmadıysanız , alternatif olarak\n hesaplarınızı ve fonlarınızı dışarı <em>beyin-anahtarı</em> ihrac ederek yedekleyebilirsiniz. \nBeyin-anahtarı anahtarlarınızın deterministik yöntemle türetildiği bir kelimeler dizisidir.</p>\n<h2 id=\"dikkat-hiyerar-ik-yetkililer-sadece-uzman-kullan-c-lar-\">Dikkat : Hiyerarşik Yetkililer (SADECE uzman kullanıcılar)</h2>\n<p>Eğer hiyerarşik yetkiler kullanıyorsanız (hesap ve/yada etkin izinler),\nsadece anahtarları yedeklemeniz fonlarınıza tekrar erişmenize yeterli olmayabilir!\nLütfen hiyerarşik yetkiler konusundaki dokümantasyonları tekrar gözden geçirin.</p>\n";

