module.exports = "<h1 id=\"c-zdan\">Cüzdan</h1>\n<p>Şu ana kadar farketmiş olduğunuz gibi bu uygulama bir web uygulamasıdır ve \ntarayacı içerisinde çalışır. Ekosistemin geri kalanına geçit görevi gören , ağda bulunan \ngüvenilir bir düğüm(node) bağlantı kurar. test</p>\n<h2 id=\"c-zdan-g-venli-i\">Cüzdan Güvenliği</h2>\n<p>İçiniz rahat olsun , sunucularımızın fonlarınıza erişimi mümkün değildir, çünkü özel \nanahtarlarınızın hiçbiri asla tarayıcınızdan ayrılmazlar. Onun yerine , parola cümlenizle \nkriptolanmış vaziyette yerel tarayıcınızın veritabanında saklı tutulurlar.\nO yüzden, bilgisayar arızaları ve tarayıcı çökmelerine karşı mutlaka uygun bir \n<a href=\"../introduction/backups.md\">Backup</a> yapmayı ihmal etmeyin. </p>\n<h2 id=\"c-zdan-y-netimi\">Cüzdan Yönetimi</h2>\n<p>Dahası , bu kullanıcı arayüzü , birden çok sayıda ve içerisinde muhtemel birçok \nhesap ve bunlara ait fonlar bulunduran ayrı cüzdanları muhafaza edebilir ve bunlara erişebilir.\n<code>Ayarlar-&gt;Cüzdanlar</code>&#39;dan ekleme, yedekleme yapabilir ve mevcut cüzdanlar arasında geçiş yapabilirsiniz.</p>\n";

