module.exports = "<h1 id=\"emek-iler\">Emekçiler</h1>\n<p>Emekçiler maaş karşılığında  hizmet veren tekliflerdir, maaşlarını blok zincirinden alırlar. Bir emekçi teklifi en azından aşağıdaki bilgileri kapsamalıdır :</p>\n<ul>\n<li>Bir başlangıç ve bitiş tarihi</li>\n<li>Gündelik bir ücret</li>\n<li>Maksimum bir toplam maaş</li>\n</ul>\n<p>Emekçi teklifinin daha detaylı anlatıldığı bir web sayfasına da bağlantı sunmalıdır.</p>\n<p>Emekçi tekliflerine verilen oylar pozitif yada negatif olabilirler, yani beğenmediğiniz bir teklife red oyu kullanabilirsiniz.</p>\n<h2 id=\"emek-i-b-t-esi-mekanizmas-\">Emekçi bütçesi mekanizması</h2>\n<p>Emekçilerin ücretleri, ilk-gelen ilk-çalışır prensibiyle günlük sabit bir bütçeden para tükenene kadar ödenir. Nasıl işlediğini görmek için şu örneğe bakın:</p>\n<ul>\n<li>Tüm Emekçiler için günlük toplam bütçe 400 bin BTS olsun</li>\n<li>Her biri günlük 100k BTS talep eden toplam oyların pozitif olduğu 5 emekçi teklifi</li>\n</ul>\n<p>Oyların çoğuna sahip 4 emekçinin her birine günlük 100 bin BTS ödenecek, fakat ödemeler tamamlandığında emekçi bütçesi tükenmiş olacak. O yüzden 5. emekçiye hiç bir şey ödenmeyecek.</p>\n";

