module.exports = "<h1 id=\"-\">钱包软件</h1>\n<p>你或许已经注意到，本应用是一个基于web的应用软件，在浏览器中运行。通过与一个受信任的节点连接来获得整个生态系统的接入。</p>\n<h2 id=\"-\">钱包安全性</h2>\n<p>你可以确信的是我们的服务器永远不会也不能访问你的资产。你的私钥不会离开你的本地浏览器。它们使用你的密码进行加密后保存在本地浏览器的数据库中。因此，你只需要确保你已经<a href=\"../introduction/backups.md\">备份</a>了钱包，就不用担心由于计算机失灵或者浏览器奔溃导致钱包数据丢失。</p>\n<h2 id=\"-\">钱包管理</h2>\n<p>钱包系统的用户界面允许你使用多个独立的钱包，每个钱包可能包含相互独立的账户和资金。你可以通过<code>设置-&gt;钱包</code>菜单进行创建、备份和切换钱包的操作。</p>\n";

