module.exports = "<h1 id=\"-\">预算项目</h1>\n<p>预算项目期望通过提供服务来从区块链获得奖金的工作项目提案。一项提案包含至少以下信息：</p>\n<ul>\n<li>开始和结束时间</li>\n<li>每日支付预算</li>\n<li>预算上限</li>\n</ul>\n<p>它还应该包含一个指向网页或论坛帖子的链接，以详细介绍工作项目内容。</p>\n<p>针对预算项目，投票人可以选择支持或者反对。</p>\n<h2 id=\"-\">预算项目支付机制</h2>\n<p>预算项目每天收到的金额来自一个金额固定的每日预算池，根据票数多寡排序进行分配，知道每日预算池中资金耗尽。举一个例子：</p>\n<ul>\n<li>每日预算池总额为400K BTS</li>\n<li>有5个预算项目符合条件（支持票多余反对票）,他们都要求每天获得100K BTS的预算支持。</li>\n</ul>\n<p>那么得票较多的4个项目将每天获得100K BTS的支付，但是由于付完这4各项目，每日预算池中已无资金剩余，那么第五个项目受付金额则为0。</p>\n";

